function SignUp () {
    return (
        <>
        <div className="Form"> 
        <h1>Form</h1> 
        <label> Name : </label>
        <input type="text" className="sname" required></input>
        <label> Username or Email : </label>
        <input type="text" className="susername" required></input>
        <label> password : </label>
        <input type="password" className="spassword" required></input>
        <input type="submit" className="submit"></input>
        </div>
        </>
    )
};
export default SignUp;
